import { Container, Objective, Hand } from './styles'

export default function NumberHand() {
  return (
    <Container>
      <Objective>Obijetivo do jogo</Objective>

      <Hand 
        source={require('../../../images/mao0.bmp')}
      />

    </Container>
  )
}
